import React, { useEffect } from "react";
import axios from "axios";

const ImageList = () => {
  useEffect(() => {
    axios
      .get("/images")
      .then((result) => console.log({ result }))
      .catch((err) => console.log(err));
  }, []);
  return <div>Image List</div>;
};

export default ImageList;
